import React from 'react'
import { useAuth } from '../auth'
const MyAccount = () => {
    const auth = useAuth()
    const handleLogout = () => {
        auth.log
    }
    return (
        <div>
            Welcome {auth.user}
            <button onClick={handleLogout}>Log Out</button>
        </div>
    )
}

export default MyAccount
